CREATE TABLE mw_bibmanager (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `bm_bibtexEntryType` varchar(255) default NULL,
  `bm_bibtexCitation` varchar(255) default NULL,
  `bm_address` varchar(255) default NULL,
  `bm_author` varchar(255) default NULL,
  `bm_booktitle` TEXT default NULL,
  `bm_chapter` TEXT default NULL,
  `bm_doi` varchar(255) default NULL,
  `bm_editor` varchar(255) default NULL,
  `bm_fulltext` TEXT default NULL,
  `bm_howpublished` varchar(255) default NULL,
  `bm_institution` TEXT default NULL,
  `bm_isbn` varchar(255) default NULL,
  `bm_journal` TEXT default NULL,
  `bm_month` varchar(50) default NULL,
  `bm_note` TEXT default NULL,
  `bm_number` varchar(50) default NULL,
  `bm_organization` TEXT default NULL,
  `bm_pages` varchar(255) default NULL,
  `bm_publisher` TEXT default NULL,
  `bm_school` TEXT default NULL,
  `bm_series` TEXT default NULL,
  `bm_title` TEXT default NULL,
  `bm_type` varchar(255) default NULL,
  `bm_url` varchar(255) default NULL,
  `bm_volume` varchar(50) default NULL,
  `bm_year` varchar(50) default NULL,
  PRIMARY KEY (`id`)
) TYPE=MyISAM AUTO_INCREMENT=1;


